INSERT INTO `v1_d6ed3773885f846ab5d090cbeab8bf59f45c6faba5e2a54548cc253e21b59fb6` VALUES (11, 1, "ちょ、ちょっとアンナさん……\nあなた全身、絵の具だらけで\n動くたびに飛び散ってますわ。\n少し大人しくしてもらえますか？", 0.5, 16612, 1, 16612031, 10, 0, 102711, 0);
