INSERT INTO `v1_d6ed3773885f846ab5d090cbeab8bf59f45c6faba5e2a54548cc253e21b59fb6` VALUES (11, 1, "あははっ！　そういうエリコ様も\nおててが絵の具だらけでござるよ～！\nむふふ、いわゆるギャップ萌え\nというやつですな？", 0.5, 16612, 1, 16612036, 10, 0, 101311, 0);
