INSERT INTO `v1_d6ed3773885f846ab5d090cbeab8bf59f45c6faba5e2a54548cc253e21b59fb6` VALUES (11, 1, "むっ、ちょっと待て。\nこの絵のテーマは、繰り返される\n運命の闘争が織りなす限りなき\nウロボロスの循環ではないのか！？", 0.5, 18812, 1, 18812031, 10, 0, 100911, 0);
