INSERT INTO `v1_d6ed3773885f846ab5d090cbeab8bf59f45c6faba5e2a54548cc253e21b59fb6` VALUES (11, 1, "クスクス……違います。\nこれはあのおかたへの愛……\n枯れることのない、永遠の愛が\nテーマですわ……", 0.5, 18812, 1, 18812036, 10, 0, 102711, 0);
